import styled, { css } from "styled-components";

export const StyledButton = styled.button`
  color: black;
  font-size: 20px;
  border-radius: 5px;

  ${prop => 
    prop.primary && 
    css`
      color: green;
    `
  };
`;

export const Container = styled.div`
  text-align: center;
`;
